};
class NgxConsole {
    log(message) {
        if (Window['ngxConsoleFilter']('log', message)) {
            console.log(message);
        }
    }
    error(message) {
        if (Window['ngxConsoleFilter']('error', message)) {
            console.error(message);
        }
    }
    warn(message) {
        if (Window['ngxConsoleFilter']('warn', message)) {
            console.warn(message);
        }
    }
}
Window['ngxConsole'] = new NgxConsole();

